import React from "react";
import "bootstrap/dist/css/bootstrap.css";

const Movies = (props) => {
  const { data: moviesList } = props;

  return (
    <div>
      {/* {console.log("movie.jsx data " + moviesList.length)} */}
      {moviesList.map((m) => {
        return (
          <list key={m.id}>
            {m.title}
            {/* <img src={m.poster_path} alt={m.title} /> */}
          </list>
        );
      })}
    </div>
  );
};

export default Movies;
